import { EventTimeMarks } from "./EventTimeMarks";
import { Order } from "./Order";
export type OrderEvent = OrderUpdateEvent | AmmOrderNftUpdateEvent;
export type OrderUpdateEvent = {
    type: "UPDATE";
    eventId: string;
    orderId: string;
    eventTimeMarks?: EventTimeMarks;
    order: Order;
};
export type AmmOrderNftUpdateEvent = {
    type: "AMM_NFT_UPDATE";
    eventId: string;
    orderId: string;
    eventTimeMarks?: EventTimeMarks;
    inNft: Array<string>;
    outNft: Array<string>;
};
